import { useRive } from '@rive-app/react-canvas';

function Rive() {
    const { RiveComponent } = useRive({
        src: '../public/mario.riv',
        autoplay: true,
    });

    return (
        <div style={{ width: '500px', height: '500px' }}>
            <RiveComponent />
        </div>
    );
}

export default Rive;
